window.onload = init;

function updateResolution () {
	height = window.innerHeight;
	width = window.innerWidth;
	
	canvas.height = height;
	canvas.width = width;

	render();
}

var canvas, ctx;
var height, width;

function init () {
	canvas = document.getElementsByTagName('canvas')[0];
	ctx = canvas.getContext('2d');
	generateMap();
	loadImages(function () {
		window.onresize = updateResolution;
		updateResolution();
	});
}

function render () {
	for (var x = 0; x < map.length; x++) {
		for (var y = 0; y < map[x].length; y++) {
			if (map[x][y]) ctx.drawImage(images[map[x][y]].object,x*16,y*16);
		}
	}
}

function generateMap () {
	var terrainHeight = 30;
	var lastTree = 0;
	for (var x = 0; x < 150; x++) {
		terrainHeight += Math.random()*2-1;
		map[x] = [];
		for (var y = 0; y < 60; y++) {
			map[x][y] = 0;
			if (y > terrainHeight) {
				map[x][y] = 3;
				if (y > terrainHeight+3) {
					map[x][y] = 1;
					if (Math.random()>0.2*(y-terrainHeight)) {
						map[x][y] = 3;
					}
					if (Math.random()<0.00005*(y-terrainHeight)*(y-terrainHeight)) {
						map[x][y] = 14;
					}
					if (Math.random()<0.00015*(y-terrainHeight)*(y-terrainHeight)) {
						map[x][y] = 15;
					}
					if (Math.random()<0.00025*(y-terrainHeight)*(y-terrainHeight)) {
						map[x][y] = 16;
					}
				}
			} else if (y >= terrainHeight-1) {
				map[x][y] = 2;
			}
		}
	}
	for (var x = 0; x < map.length; x++) {
		if (lastTree < x-4 && Math.random() < 0.1 && x+2 < map.length && x-2 > 0) {
			for (var y = 0; y < map[x].length; y++) {
				if (map[x][y] == 2) terrainHeight = y;
			}
			lastTree = x;
			map[x][Math.floor(terrainHeight)] = 3;
			map[x][Math.floor(terrainHeight)-1] = 17;
			map[x][Math.floor(terrainHeight)-2] = 17;
			map[x][Math.floor(terrainHeight)-3] = 18;
			map[x][Math.floor(terrainHeight)-4] = 18;
			map[x-1][Math.floor(terrainHeight)-3] = 18;
			map[x-1][Math.floor(terrainHeight)-4] = 18;
			map[x-2][Math.floor(terrainHeight)-3] = 18;
			map[x-2][Math.floor(terrainHeight)-4] = 18;
			map[x+1][Math.floor(terrainHeight)-3] = 18;
			map[x+1][Math.floor(terrainHeight)-4] = 18;
			map[x+2][Math.floor(terrainHeight)-3] = 18;
			map[x+2][Math.floor(terrainHeight)-4] = 18;
			map[x-1][Math.floor(terrainHeight)-5] = 18;
			map[x][Math.floor(terrainHeight)-5] = 18;
			map[x+1][Math.floor(terrainHeight)-5] = 18;
		}
	}
}

