function loadImages (callback) {
	var loaded = 0;
	var toLoad = 0;
	for (var i in images) {
		toLoad++;
		images[i].object = new Image();

		images[i].object.onload = function() {
			if (++loaded == toLoad) {
				callback();
			}
		};
		images[i].object.src = images[i].url;
	}
}
